webpackJsonp([57551573573134],{2525:function(e,t){e.exports={pathContext:{docHtml:'<h3>v4.0.1 (2016-12-14)</h3>\n<h4>WHOOPS</h4>\n<ul>\n<li><a href="https://github.com/npm/nopt/commit/fb9b1ce57b3c69b4f7819015be87719204f77ef6"><code>fb9b1ce</code></a>\nMerged so many patches at once that the code fencing\n(<a href="https://github.com/adius">@adius</a>) added got broken. Sorry,\n(<a href="https://github.com/adius">@adius</a>)!\n(<a href="https://github.com/othiym23">@othiym23</a>)</li>\n</ul>\n<h3>v4.0.0 (2016-12-13)</h3>\n<h4>BREAKING CHANGES</h4>\n<ul>\n<li><a href="https://github.com/npm/nopt/commit/651d4473946096d341a480bbe56793de3fc706aa"><code>651d447</code></a>\nWhen parsing String-typed arguments, if the next value is <code>""</code>, don\'t simply\nswallow it. (<a href="https://github.com/samjonester">@samjonester</a>)</li>\n</ul>\n<h4>PERFORMANCE TWEAKS</h4>\n<ul>\n<li><a href="https://github.com/npm/nopt/commit/3370ce87a7618ba228883861db84ddbcdff252a9"><code>3370ce8</code></a>\nSimplify initialization. (<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/356e58e3b3b431a4b1af7fd7bdee44c2c0526a09"><code>356e58e</code></a>\nStore <code>Array.isArray(types[arg])</code> for reuse.\n(<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/0d95e90515844f266015b56d2c80b94e5d14a07e"><code>0d95e90</code></a>\nInterpret single-item type arrays as a single type.\n(<a href="https://github.com/samjonester">@samjonester</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/07c69d38b5186450941fbb505550becb78a0e925"><code>07c69d3</code></a>\nSimplify key-value extraction. (<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/39b6e5c65ac47f60cd43a1fbeece5cd4c834c254"><code>39b6e5c</code></a>\nOnly call <code>Date.parse(val)</code> once. (<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/934943dffecb55123a2b15959fe2a359319a5dbd"><code>934943d</code></a>\nUse <code>osenv.home()</code> to find a user\'s home directory instead of assuming it\'s\nalways <code>$HOME</code>. (<a href="https://github.com/othiym23">@othiym23</a>)</li>\n</ul>\n<h4>TEST &#x26; CI IMPROVEMENTS</h4>\n<ul>\n<li><a href="https://github.com/npm/nopt/commit/326ffff7f78a00bcd316adecf69075f8a8093619"><code>326ffff</code></a>\nFix <code>/tmp</code> test to work on Windows.\n(<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/c89d31a49d14f2238bc6672db08da697bbc57f1b"><code>c89d31a</code></a>\nOnly run Windows tests on Windows, only run Unix tests on a Unix.\n(<a href="https://github.com/elidoran">@elidoran</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/affd3d1d0addffa93006397b2013b18447339366"><code>affd3d1</code></a>\nRefresh Travis to run the tests against the currently-supported batch of npm\nversions. (<a href="https://github.com/helio">@helio</a>-frota)</li>\n<li><a href="https://github.com/npm/nopt/commit/55f94497d163ed4d16dd55fd6c4fb95cc440e66d"><code>55f9449</code></a>\n<code>tap@8.0.1</code> (<a href="https://github.com/othiym23">@othiym23</a>)</li>\n</ul>\n<h4>DOC TWEAKS</h4>\n<ul>\n<li><a href="https://github.com/npm/nopt/commit/5271229ee7c810217dd51616c086f5d9ab224581"><code>5271229</code></a>\nUse JavaScript code block for syntax highlighting.\n(<a href="https://github.com/adius">@adius</a>)</li>\n<li><a href="https://github.com/npm/nopt/commit/c0d156f229f9994c5dfcec4a8886eceff7a07682"><code>c0d156f</code></a>\nThe code sample in the README had <code>many2: [ oneThing ]</code>, and now it has\n<code>many2: [ two, things ]</code>. (<a href="https://github.com/silkentrance">@silkentrance</a>)</li>\n</ul>',docPath:"argo-ci/node_modules/fsevents/node_modules/nopt/changelog",proj:"argo-ci"}}}});
